["function(x, df, grp, threshold) {
      ti <- mean(
        as.numeric(
          diff(
            as.POSIXct(df[[grp]], format = "%Y-%m-%d %H:%M:%S")
          ), units = "hours"
        )
      )
      if (ti < threshold){
        df[[grp]] <- as.Date(as.POSIXct(df[[grp]], format = "%Y-%m-%d %H:%M:%S"))
        df <- aggregate(x ~ df[[grp]], data = df, FUN = function(x) sum(x, na.rm = TRUE))
        return(df)      
      }
    }"]

